mechanism of demyelination whereby the abrupt destruction of astrocytes induces a HSV-associated demyelination.", "We inoculated the P strain of HSV-1 on the cornea of twenty-two 6 to 8-week-old female BALBic mice by placing a drop of stock virus containing lo* plaque forming unit on both corneas and scarifying the cornea with a 17-gauge needle [3] . These inoculted mice were killed on 2, 4, 6, 8, 10, and 14 days postinoculation (PI). They were anesthetized with ether and perfused for 10 minutes through the heart with a fixative mixture of mercuric chloride and formalin. The pons, trigeminal roots, and ganglia were carefully removed, dissected, postfixed overnight in the same fixative, dehydrated in a graded series of ethanol and p-dioxane, and embedded in paraffin. Sections 6 pm thick were cut, mounted serially on numbered glass slides, and immunostained by using the peroxidase antiperoxidase (PAP) method [4}. Sections were treated sequentially with 3% normal sheep (or rabbit) serum, the primary antisera, sheep antirabbit (or goat) IgG diluted 1:40, rabbit (or goat) PAP diluted 1 :80, and 3,3'-diaminobenzidine HCl with hydrogen peroxide. All dilutions were made with 0.5 M Tris buffer.", "The following antibodies were used at the second step: anti-HSV-1 rabbit serum (diluted 1:500) for detection of HSV-I virus antigens, anti-myelin basic protein (MBP) goat serum (diluted 1:500) for CNS and PNS myelin, anti-Po glycoprotein rabbit serum (diluted 1:500) for PNS myelin protein, anti-glial fibrillary acidic protein (GFAP) (diluted 1 : 1,000) rabbit serum for astrocytes. Anti-HSV antibody (500 neutralizing units) was obtained from a New Zealand White rabbit after multiple intravenous inoculations of lo8 PFU of HSV. Immunocytochemical controls for HSV antigen detection included trigeminal ganglion sections from uninfected mice incubated with the anti-HSV serum and also sections from infected mice incubated with nonimmune rabbit serum. Both of these controls were invariably negative for immunoperoxidase staining. Immunoreactivity and control studies of anti-MBP serum IS], anti-Po serum (61, or anti-GFAP serum [ 7 } are described elsewhere.", "The double staining method was used for the simultaneous identification and localization of two antigens (GFAP and HSV antigens) by using a modification of procedures described by Erlandsen and colleagues IS]. To obtain two different colors, the following substrates of peroxidase were used; 3,3'-diaminobenzidine for brown reaction products and 4-CI-1 naphthol for blue reaction products. The blue reaction produced by 4-CI-1 naphthol tends to fade a few hours after immunostaining, so co-localization of GFAP and HSV antigens to the same cells was confirmed by serial examination of the slides and recording the loss of the blue color from the doubly stained cells.", "Attempts were made to identify by immunohistochemistry oligodendroglia with antisera, but consistently satisfactory immunostaining could not be obtained in this formalin-fixed material. Also, attempts were made to do electronmicroscopy by removing the paraffin-embedded pons and trigeminal roots used for immunohistochemical staining and reembedding the tissue in epon resin for thin sectioning. Review of this material identified degenerating astrocytes containing viral particles. Poor morphological details due to mercuric chloride fixation, however, precluded definitive study and presentation of the electronmicrographs.", "To compare the immunocytochemical findings observed in HSV-induced demyelinated lesions with other cases of demyelination, we reexamined immunocytochemically lesions of experimental allergic encephalomyelitis (EAE), progressive multifocal leukoencephalopathy (PML), and acute multiple sclerosis (MS). We immunostained paraffin sections of pontine lesions of EAE rats killed 10 and 14 days after immunization [9}, and sections of cerebral lesions of PML (Patient 4; 61-year old man) [lo] and pontine lesions of acute MS (Patient 1; 6-year-old girl) [ll}. The antibodies used were anti-MBP goat serum and anti-GFAP rabbit serum at a dilution of 1:500 and 1:1,000, respectively.", "The CNS-PNS transition in the trigeminal root was clearly demonstrated by GFAP-stained dial cells in the CNS portion and Po-stained PNS myelin in the PNS portion (Fig 1) . MBP antiserum stained both the CNS and PNS myelin. HSV immunoreactivity was never observed in the normal trigeminal ganglia, roots, or pons.", "HSV immunoreactivity first appeared in neurons within the trigeminal ganglion on day 2 PI. In the ganglion, the HSV-stained neurons and satelhe cells rapidly increased in number on day 4 PI and decreased on day 6 PI, and stained cells were no longer detected on day 8 PI, as already reported [12] . In the trigeminal root, HSV immunoreactivity was observed in some glial cells in the CNS part of the TREZ on day 4 PI (Fig 2) . Most of the HSV-stained glial cells were morphologically normal. There was no inflammatory cell infiltration around these HSV-stained glial cells. Immunostaining of GFAP, MBP, and Po was generally normal. O n day 6 PI, the HSV-stained glial cells increased in number. The distribution of infected cells was restricted to the medial aspect of the CNS part of the root extending from the PNS-CNS transitional zone to the junction of the pons (Fig 3) . In the lesions, many HSV-stained glial cells were destroyed to small fragments or debris. With double immunostaining, most HSV-stained cells or their fragments were also stained with anti-GFAP serum (Fig 4) . Most of the astrocytes, doubly stained with GFAP and HSV antiserum, were degenerating within such a restricted area. Therefore, the lesion was observed as an area lacking in GFAP immunoreactivity (Fig 5) . In contrast to the remarkable changes in the astrocytes, the CNS and PNS myelinated fibers were immunocytochemically or morphologically normal, except for a few CNS fibers with an altered immunoreactivity near the infiltrating mononuclear cells (see Fig 5) . O n day 8 PI, CNS myelinated fibers began to change, both immunocytochemically and morphologically in the area where GFAP staining was completely lacking. Here, the HSV-stained glial cells were no longer observed in the lesion. O n day 10 PI, an active destruction of CNS myelin was apparent and an area lacking in MBP immunostaining was evident. Interestingly, the extent of the demyelinated lesions was similar to the area where the GFAP immunostaining was lacking and the demyelination never extended beyond the area lacking GFAP ", "In demyelinating lesions of EAE (10 and 14 days PI), PML, and acute MS, actively demyelinating changes were observed, as described elsewhere {9-11) (Fig 8) . Alteration or loss of MBP immunoreactivity was observed in the degenerating myelin sheaths. MBPstained myelin debris or macrophages containing MBP-stained materials were numerous, yet astrocytes were intact immunocytochemically and morphologically, even near infiltrating mononuclear cells or macrophages. O n the contrary, the GFAP-stained astrocytes were increased in number and immunoreactivity in the surrounding lesions compared with findings in the control rat CNS or nonneurological control brains. In these lesions, there were hypertrophic astrocytes heavily stained with GFAP antiserum. [ 13) and coronavirus infection in mice ation in T-cell-deficient (nude) mice and cyclophosphamide-immunosuppressed mice inoculated with HSV by the corneal route. Even in immunocompetent mice, only rare macrophages were noted stripping myelin lamellae, and it was supposed that bystander rather than immune-specific demyelination was the main mechanism, with demyelination produced by proteases released from activated macrophages 120). Obtaining the opposite result of more widespread and severe de- 4 ) indicates that at the early stage, the HSV-1 infection is overwhelmingly in astrocytes. There is rapid lysis of astrocytes as shown by focal areas in which GFAP immunostaining is completely lost by 6 days after HSV inoculation. Loss of MBP immunostaining indicating demyelination begins just after this extensive lysis of astrocytes, and the area of demyelination as defined by loss of MBP immunostaining is strictly confined to the area of astrocyte destruction as shown by loss of GFAP immunostaining. In contrast, we have found in lesions of acute MS and in early lesions of PML and EAE that there are no degenerative changes in astrocytes, morphologically or immunocytochemically; but we did observe reactive astrocytes or astrocytosis in these lesions. Therefore, it is likely that the early loss of astrocytes is characteristic of HSV-induced demyelination and not other demyelinating lesions.", "Astrocytes have long been thought to play a skeletal role in the CNS, separating various synapses and serving as a means of nutrient transport from blood to neurons; and astrocyte proliferation is a well-known response to nonspecific CNS damage. The astrocyte also plays an immunological role for presenting antigen to T lymphocytes {29]. They express major histocompatibility complex class 1 antigen on their surface and would be targets for class I-restricted cytolytic T lymphocytes [30}. In addition, recent experimental studies have suggested the requirement of astrocytes for regeneration of CNS myelin {31-337.", "On the basis of the studies reported here, it is tempting to speculate that the rapid astrocyte destruction itself contributes to HSV-induced demyelination. Neither the temporal sequence of astrocyte loss preceding demyelination nor the correspondence in areas of astrocyte destruction and demyelination, however, prove a cause and effect relation. It has been shown that HSV infection in oligodendroglia follows a longer time course and there is relative preservation of oligo-dendroglia at the time of extensive astrocyte loss and onset of destruction of myelin lamellae [1, 251, but we cannot exclude oligodendroglia damage as a cause of the demyelination. More detailed study of HSV-1 infection in oligodendroglia is needed to help determine the significance of the early astrocyte loss in this model."],
