  abstract: {
    text: ["Several epidemiologic models have been published to forecast the spread of the COVID-19 pandemic yet there are still uncertainties regarding their accuracy.", "We report the main features of the development of a novel freely accessible model intended to urgently help researchers and decision makers to predict the evolution of the pandemic in their country."],
