    text: ["We built a SIR-type compartmental model with additional compartments and features. We made the hypothesis that the number of contagious individuals in the population was negligible as compared to the population size. We introduced a compartment D corresponding to the deceased patients and a compartment L representing the group of individuals who will die but who will not infect anybody (due to social or medical isolation). Our model integrated a time-dependent transmission rate, whose variations can be thought to be related to the public measures taken by each country and a cosine function to incorporate a periodic weekly component linked to the way in which numbers of cases and deaths are counted and reported, which can change from day to day.", "The model was able to accurately capture the different changes in the dynamics of the pandemic for nine different countries whatever the type of pandemic spread or containment measures. The model provided very accurate forecasts in the relatively short term (10 days).", "In early evaluation of the performance of our model, we found a high level of accuracy between prediction and observed data, regardless of the country. The model should be used by the community to help public health decisions as we will refine it over time and further investigate its performance.", ". CC-BY-NC-ND 4.0 International license It is made available under a is the author/funder, who has granted medRxiv a license to display the preprint in perpetuity. (which was not certified by peer review)", 'The coronavirus disease 19 (COVID-19) pandemic has been a disruptive event for most healthcare systems across the globe. It has led governments to take both public measures for population containment and often a resetting of healthcare organization in order to be able to absorb the peak of patients in particular for critical care. Since the inception of the outbreak, all stakeholders seemed keen to access to reliable and "living" information regarding the evolution of cases, hospitalisations and deaths in their countries as well as in others. Crossareas comparisons were made to understand some characteristics of this novel epidemic. [1, 2] Also, being able to predict at least in the short term, the evolution of the main outcome indicators has been a relentless objective of care providers and decision makers. A single tool providing such an aid would be likely to respectively inform people and enlighten relevant stakeholders to anticipate the needed measures, in particular regarding the steering of care and social measures. We therefore developed an online model, intended to be freely accessible to the community.', "The aim of this study was to report the development of the model as well as some representative data demonstrating its workability and suggesting its accuracy in studying different countries.", "We built a SIR-type compartmental model for the Covid-19 data provided by the Johns-", "University (https://github.com/CSSEGISandData/COVID-19/tree/master/csse_covid_19_data/csse_covid_19_time_series). [3] . CC-BY-NC-ND 4.0 International license It is made available under a is the author/funder, who has granted medRxiv a license to display the preprint in perpetuity. (which was not certified by peer review)", "The copyright holder for this preprint this version posted May 21, 2020. . https://doi.org/10.1101/2020.05.17.20104885 doi: medRxiv preprint 4 The model is a parametric model whose parameters change from country to country to reflect differences in dynamics. A classical SIR model considers 3 types of individuals: susceptible individuals (S), infected individuals (I) and recovered individuals (R). [4] Many extensions to this model have been proposed, in particular by adding a compartment of exposed but noncontagious individuals (E) to the model. [5] Other models distinguish between symptomatic and asymptomatic patients, between patients admitted to intensive care units and patients admitted to regular hospital. [6] [7] [8] The more complex these models are, the more parameters they depend on. A classical method then consists of fixing the value of some of these parameters to values found in the literature and varying the other parameters in order to obtain simulations with dynamics that are similar to those of the data. The main objective of these approaches is not to adjust data, but rather to develop a model that is supposed to represent the reality as closely as possible. Our approach was different: our main objective was to develop an epidemiological model that fits the observed data as closely as possible, while at the same time being as simple as possible.", "However, we did not aim to develop an empirical model that looks like the data (e.g. using a polynomial model): the model and its parameters must have a real epidemiological interpretation, in terms of transition from one state to another or length of stay in a state. On the one hand, we made the hypothesis that the number of contagious individuals in the population was negligible as compared to the population size, which is realistic as the latest studies suggest an infection rate of around 5% in several countries.", "[9] This hypothesis allowed us to ignore the compartments S of the model. On the other hand, we had to take into account the fact that not all patients were cured but that a certain proportion may die. We therefore introduced a compartment D corresponding to the deceased patients.", "As an examination of the data at first glance showed that there was a delay between new infections and deaths, we therefore added an additional compartment L in the model, which . CC-BY-NC-ND 4.0 International license It is made available under a is the author/funder, who has granted medRxiv a license to display the preprint in perpetuity.", "The copyright holder for this preprint this version posted May 21, 2020. . https://doi.org/10.1101/2020.05.17.20104885 doi: medRxiv preprint 5 represents the group of individuals who will die (because they were infected), but who will not infect anybody (for instance due to social or medical isolation). (Figure 1) A fundamental parameter of the model is the transmission rate, which indicates how quickly people become infected and become contagious themselves. Our model integrates a timedependent transmission rate, whose variations can be thought to be related to the public measures taken by the country in question. One can thus imagine that the transmission rate was stable -and possibly high -before lockdown and then decreased with lockdown in countries that have adopted such a measure. A piecewise linear model was used for the transmission rate to take into account these possible variations. As the number of segments and the location of the changes in the slope are unknown, they were estimated together with the model parameters.", "The data available for each country are the daily number of confirmed cases (bearing in mind that it is a number that represents an unknown fraction of the true total number of cases) and the daily number of deaths.", "A periodic weekly component appears in each of these series, for many countries. This component is of course not related to the dynamics of the epidemic, which has no scientific reason to change across the days of the week, but rather to the way in which the numbers of cases and deaths are counted and reported, which can change from day to day. This component is taken into account in the observation model in the form of a cosine function.", "Once the model is fully defined, its parameters can be estimated for each country using precisely that country's data.", "The model, the parameter estimation algorithm, the method for model selection as well as several plotting routines have been implemented in the R package covidix. This package is . CC-BY-NC-ND 4.0 International license It is made available under a is the author/funder, who has granted medRxiv a license to display the preprint in perpetuity.", "The copyright holder for this preprint this version posted May 21, 2020. . https://doi.org/10.1101/2020.05.17.20104885 doi: medRxiv preprint 6 available on Github (https://github.com/MarcLavielle/covidix). An example of how to use covidix can be found here: http://webpopix.org/covidixExample.html.", "Note that an interactive, easy to use, web application (Shiny v1.4.0.2, 2020) also allows to visualize the data and the fitted model for several countries (http://shiny.webpopix.org/covidix/app2/). The data used in this application are updated frequently in order to be able to follow on a day-to-day basis what the model predicts for several countries.", "A first version of the covidix package and the web application were available as of April 12 th , with model adjustments on data from eight countries. Nine new countries were added between April 12, 2020 and May 15, 2020. . CC-BY-NC-ND 4.0 International license It is made available under a is the author/funder, who has granted medRxiv a license to display the preprint in perpetuity.", "The copyright holder for this preprint this version posted May 21, 2020. . https://doi.org/10.1101/2020.05.17.20104885 doi: medRxiv preprint 7 The model also allowed us to estimate the day of the peak of daily deaths in each country (Table 1) . Moreover, the delay in days for a two-or four-folds increase or decrease in the number of deaths was assessed by the model. For instance, in Denmark, the number of deaths initially doubled every 8 days and after the peak, the number of deaths were divided by 2 or 4 every 25 days or 50 days, respectively.", "The almost unprecedented magnitude of the COVID-19 pandemic has made epidemiologic models critical not only for researchers but also for policy makers. can also be seen as a monitoring tool.", ". CC-BY-NC-ND 4.0 International license It is made available under a is the author/funder, who has granted medRxiv a license to display the preprint in perpetuity.", "The copyright holder for this preprint this version posted May 21, 2020. () and t1/2 () are, respectively, the number of days it took to multiply the number of deaths by 4 and 2 ; t1/2 () and t1/4 () are, respectively, the number of days it took to divide the number of deaths by 2 and 4.", ". CC-BY-NC-ND 4.0 International license It is made available under a is the author/funder, who has granted medRxiv a license to display the preprint in perpetuity.", "The copyright holder for this preprint this version posted May 21, 2020. is the author/funder, who has granted medRxiv a license to display the preprint in perpetuity. (which was not certified by peer review)", "The copyright holder for this preprint this version posted May 21, 2020. . https://doi.org/10.1101/2020.05.17.20104885 doi: medRxiv preprint 1 2 . CC-BY-NC-ND 4.0 International license It is made available under a is the author/funder, who has granted medRxiv a license to display the preprint in perpetuity. (which was not certified by peer review)", "The copyright holder for this preprint this version posted May 21, 2020. . https://doi.org/10.1101/2020.05.17.20104885 doi: medRxiv preprint"],
