    sents: ["Lactate dehydrogenase, a Risk Factor of Severe COVID-19 Patients: A Retrospective and Observational Study", "To assess the risk factors of the demographic, characteristics and laboratory indicators on the severity of COVID-19 patients, logistic regression analysis was performed on the parameters of significant difference using t test.", "In univariable analysis, odds ratio of SOFA score, Curb-65 score, serum CKMB concentration and serum IgA level were the highest in severe patients.", "Male patients infected with SARS-cov-2 showed as an independent risk factor for getting severer condition as 3.76 (1.", "Apart from the risk factors above, APACHE II score, PSI score, white blood cell count, neutrophil count, serum AST, ALT, LDH, Urea, CRP, BNP level, PT, APTT were all associated with the severity of COVID-19 patients.", "Meanwhile, we found that the lymphocyte counts, monocyte counts, CD3 + , CD4 + , CD8 + , and CD16 + CD56 + lymphocyte counts were protective factors (OR < 1) for COVID-19 patients.", "Based on the condition we mentioned, laboratory indictors CRP, AST and LDH (P < 0.001) were chosen as the three variables for multivariable logistic regression model.", "As a result, serum LDH level was ruled out as a risk factor for the severity of COVID-19 patients (OR:1.02, 95% CI:1.01-1.03, P < 0.05) ( Table 3 )."]
