    sents: ["Journal Pre-proof Managing Asthma during COVID-19: An Example for Other Chronic Conditions in Children and Adolescents Title Page: Managing Asthma during COVID-19: An Example for Other Chronic Conditions in Children and Adolescents", "The evidence on COVID-19 risk factors derives largely from the adult population.", "Four case series, all from Wuhan, China, of adults admitted to hospital with COVID-19 did not list asthma as an underlying pre-existing condition in any of those patients.", "(12, (15) (16) (17) In a large case series of 1099 adult patients from 552 hospitals in 30 provinces in China, asthma was not listed as a pre-existing condition in any of the patients described.", "(18) In contrast, recent data released from the CDC of U.S. hospitalizations in March,2020 notes that 27.3% of adults 18-49 years of age who were hospitalized with COVID-19 had a history of asthma.", "(3) In adults aged 50-64 years of age hospitalized for COVID-19 asthma was present in 13.2% and in those 65 years or older asthma was present in 12.9%.", "(3,19) As a result, the American Academy of Allergy, Asthma & Immunology (AAAAI) notes that 'those with asthma in the 18-49 year old age range may be at increased risk of hospitalization due to COVID-19.'", "(19) Although there is a paucity of literature on pediatric risk factors, the case series to date from Wuhan on hospitalized pediatric cases don't list asthma as a pre-existing risk factor for morbidity or mortality.", "(10, 11) It is further reassuring that children appear to be at lower risk of COVID-19 morbidity and mortality than the adult population in general, although severe infection still can occur.", "(13, 20) The CDC morbidity and mortality report notes that among the 149,082 reported U.S. cases of COVID-19 for which age is known, only 2572 (1.7%) occurred in children 18 years and younger.", "(3) Although among the patients with information on underlying conditions, 23% had at least one underlying condition such as asthma, only 5.7% of children infected with COVID-19 required hospitalization (compared with 10% of adults aged 18-64 years) and only 3 deaths were reported in children (<1% of pediatric cases).", "In a case series from China of 72,000 cases, approximately 1% were children aged 0 to 18 years of age with only 1 death reported in the adolescent population (and none in children under the age of 10 years).", "(13, 21) Another risk in children with asthma is that infection with COVID-19 could trigger a viral- In summary, based on available information to date, it is unclear whether there is a significantly increased risk of COVID-19 morbidity among asthmatic children.", "(8, 9) It is also unknown whether asthma medications such as high-dose inhaled corticosteroids or asthma biological therapies pose a risk in managing COVID-19 infections.", "Before any definitive conclusions can be drawn, larger scale data are required from pediatric populations, and from heterogeneous locations that have been impacted by COVID-19.", "It also remains unclear if COVID-19 increases the risk of asthma exacerbations.", "As a result, good asthma control is essential as a precautionary measure during this time.", "(8, 9, 13, 20)"]
