    sents: ["Epilepsy and COVID-19: Associations and important considerations SARS-CoV-2: severe acute respiratory syndrome coronavirus 2 CDC: Center for Disease Control and Prevention", "The Center for Disease Control and Prevention (CDC) suggests that neurological comorbidities, including epilepsy, may be a risk factor for COVID-19, despite the lack of evidence.", "Presently, a medical history of epilepsy has not been reported to be a risk factor for developing COVID-19.", "Moreover, past experiences with infectious diseases do not suggest any associations.", "Considering the experience with previous infectious diseases, some societies suggest that epilepsy itself seems unlikely to represent a risk J o u r n a l P r e -p r o o f factor for COVID-19.", "(Table 1 ) However, certain pre-existing conditions (such as smoking, obesity, diabetes, heart disease, lung disease, and cancer) are recognized as risk factors [3, 4] .", "Therefore, epilepsy patients with these comorbidities may adopt a more cautionary approach regarding COVID-19.", "Conversely, children infected with COVID-19, including those just with well-controlled epilepsy and no other health conditions, are generally asymptomatic or present with mild symptoms [5] ."]
