    text: ["Most science textbooks present decontextualized, or abstracted, knowledge. Cases, however, situate the knowledge in real-world contexts. Here, the cases provide the primary occasion for learning, rather than serve secondarily as illustrations or applications. Nor are cases merely teasers or hooks for opening a presentation of abstract content. Rather, the cases become integral to the structure of learning.", "Contextualization fosters two major effects. First, it enhances learning by providing associations that facilitate memory storage, retention, and retrieval: the knowledge is more meaningful. Second, it also helps motivate learning. Cases convey that the knowledge is relevant or useful, sometimes by showing its human dimension. Such contextual and human connections seem especially important (in today's culture) in fostering interest among women/girls and minorities, as well as among nonmajors. Such benefits indicate a vital role for careful selection of cases to fit particular groups of students, their contexts (age, locality, culture), interests, and levels of background knowledge.", "CBL, however, may not provide a comprehensive and organized view of the knowledge, typically conveyed in didactic approaches. That is, the formal structure of a substantial domain of knowledge may not be evident when knowledge is accumulated by piecemeal sampling. (For example, a case profiling only a few organelles in the cell may eclipse awareness of the full diversity of organelles. A focus on just the nitrogen cycle alone may forsake a broader awareness of other mineral cycles and their general role in ecosystems.) Nevertheless, a carefully constructed curriculum may use complementary cases to cover standard curricular content (see Schwartz et al., 1997). On the other hand, some evidence indicates that learning occurs primarily, or most vividly, through exemplars (Kolodner et al., 1996; Gentner et al., 2003; Gentner and Colhoun, 2008). One case or example serves as a model, or paradigm, for interpreting other similar cases (Kuhn, 1970, pp. 23, 187191). A well-articulated sample may be as valuable as comprehensive coverage.", "For more on the benefits and limits of CBL generally, see Barnes et al. (1994) and Lunberg et al. (1999). For sample textbooks using a case structure, see (at the undergraduate level) Postlethwait and Hopson (2003) and Schwartz et al. (1997) and (at the secondary level) Leonard et al. (1998, 2008) and American Chemical Society (2006).", "Another way to engage students in their own learning is posing problems for students to solve. These embody the rationale for learning, which is elsewise typically based solely on the authority of the instructor (or, by default, a textbook). Typically, such problems are rooted in cases (although they need not be, or the case itself may be quite minimalistic). Not all CBL is problem based, however. Cases may function merely as narratives, or as a setting for knowledge. This may be so even when a story (say, the case of an important historical discovery) helps students learn how a scientist encountered and solved a problem.", "In PBL, the problem is posed to the student, who then takes an active role in solving it. Active learningitself expressed in various waysis widely recognized as enhancing motivation and depth and persistence of learning (Bonwell and Eison, 1991; Michael, 2006; see section on autonomy below). The introduction of cogent problems thus tends to amplify the basic virtues of using cases themselvesprovided the problems are framed in ways relevant to the student. Almost any declarative knowledge can be rephrased as a question or problem. However, just as a case should be judiciously selected, a problem should be properly framed and contextualized if it is indeed to be motivational. The teacher who begins, without context, Today we study the pancreas; now, what is a pancreas?, does not engage student interest. Indeed, students can easily spot a rhetorical problem or pseudoproblem. Cookbook problems are just like cookbook labs. A teacher who needs to institute substantial external motivators for students to complete work, for example, has probably not found the proper problem to inspire active, student-centered learning. One may consider framing and contextualizing problems as one of the primary instructional skills for this mode of teaching.", "In addition, engagement with problems introduces a deeper layer of thinking: about the generation of knowledge, about the nature or quality of evidence, about reasoning, and so on. It may foster a habit of curiosity or of questioning assumptions. Problems tend to promote reflective thinking. Posing problems provides an opportunity, but an instructor must also highlight these features in student activities and assessments.", "Cases may certainly combine a case narrative and problems. One effective method interrupts a story or punctuates it with a series of well-contextualized problems (Hagen et al., 1996; Herreid, 2005).", "For more on the benefits and limits of PBL generally, see Duch et al. (2001), Dochy et al. (2003), Hmelo-Silver (2004), and Major and Palmer (2001). Also relevant is the substantial literature on the role of anomalies, discrepant events, and cognitive dissonance in stimulating learning.", "The pedagogical function of cases or problems can vary. In a widely used model (Barrows, 1986), the problem is considered primarily a vehicle for learning content, which ultimately answers the given question or solves the problem at hand. In other cases, the problem engages students in practicing or developing problem-solving skills through firsthand experience. (Here, one should plan on providing a framework for students to learn new skills, not just exercise existing abilities.) Both styles, appropriately adapted, may also help foster deeper understanding of the nature of science (or of scientific practice, how science works, or the context of science broadly speaking). However, learning about the nature of science should be both explicit and reflective (Craven, 2002; Schwartz et al., 2004; Scharmann et al., 2005; Seker and Welsh, 2005). That is, one should pose problems specifically about the nature of science and engage students in discussion. These three aims are not necessarily mutually exclusive. Some cases may well integrate these (e.g., see Hagen et al., 1996; Allchin, 2012).", "The ultimate aim of education will be reflected inand communicated to students most vividly throughthe forms of evaluation. Initiating efforts to teach problem-solving skills or understanding of the nature of science may well require a shift in modes of assessment and/or grading standards. Teachers will surely benefit in any event by reflecting how the learning objectives of their courses are coupled to the ways they ask students to demonstrate or exhibit such learning.", "The problems students encounter can be of two general kinds: problems in which students can use knowledge that already exists or problems that involve research that generates new knowledge. (New, here, is defined relative to the student.) Repairing a car engine is quite different from designing one. Diagnosing a patient with an already documented disease is quite different from studying the etiology of a wholly new disease. The terms investigation, research, or problem solving are all potentially ambiguous, denoting either alternative. But research in solving a problem is substantively different from research that generates the knowledge used to solve such problems: crudely the difference between technology and science.", "If the learning objectives emphasize content and/or its cultural contexts, one can ostensibly focus on applications alone. Students will draw on a known repertoire of knowledge. (This is typical of problem cases or scenarios in medicine, law, business, engineering, applied ethics, and other professional trainingareas in which PBL and CBL first emerged. All are based on precedent, even if the cases invite creatively recombining existing ideas.)", "However, if one wants students to learn about the process of science or research, the problems should be about developing knowledge: exploring genuine unknowns (for the student) and creating knowledge, not merely finding or interpreting known facts. Students should experience science in the making, as opposed to ready-made science (Latour, 1987). Learning about the role of empirical evidence as a foundation of scientific knowledge is critical to shaping one dimension of epistemological understanding: Is knowledge justified by omniscient authority or evidence (Schommer, 1990)?", "The knowledge-generating/knowledge-applying distinction does not currently seem widely discussed in treatments of CBL and PBL. Yet failure to recognize the distinction can foster misleading impressions about the aims, benefits, or structure of PBL in science education.", "Cases may be historical or contemporary, or completely abstracted from any historical context. Here, the relevant dimension (using history as a label) is whether the problem being considered has been solved or remains unsolved. The status of the problem's solution is critical to the possible epistemic lessons about how knowledge is developed.", "Contemporary cases often appeal to students by being relevant, current, or fashionable. They convey that science is happening now, affording a sense of immediacy or authenticity (Wong et al., 2008). Students may even encounter some cases in the news (relevant just to the degree that students seriously attend to current events). Current problem cases that focus on the context of science can offer rehearsals for participating in personal decision making or social policy in future life. However, care should be taken in such cases to enrich the learning rather than merely elicit and reinforce existing perspectives. Ironically, evaluating the epistemic process in such cases is problematic. One needs time to know whether a proposed solution ultimately turned out to be reliable or well considered.", "Historical cases have their own virtues (Conant, 1947; Nash, 1951; Hagen et al., 1996, pp. vvii; Allchin, 1997, 2012). First, the benchmark content knowledge in standard science curricula originated long ago. The strategic pedadgogical constructivist will thus look to history for clues about how such concepts may be constructed from earlier facts and perspectives, as well as how they may be alternatively conceived or criticized. Imagine the sense of validation when informing a student that the concept he or she just developed is the same concept discovered earlier by a famous scientist! Second, historical narratives are prime opportunities for teaching about scientific practice, because historians are able to render the historical context, bringing together experimental details with cultural events and perspectives and scientific disputes. These are the elements for recreating science in the making. Students may participate in (re)generating knowledge at a conceptual level corresponding to their own.", "Third, history seems essential for conveying certain lessons about the nature of science, most notably about cultural bias in scientific ideas, conceptual change, and uncertainty and error (or how scientific knowledgenew findings, in particularcan be uncertain and/or provisional) (Solomon et al., 1992; Irwin, 2000). Tentativeness of scientific knowledge, for example, has been a pervasive learning goal in science education for many decades (Lederman et al., 1998), and constitutes a significant dimension of epistemological beliefthe stability of scientific knowledge (Schommer, 1990). To learn about conceptual change, however, one ideally engages in and experiences the change. Here, a case should be properly contextualized in history, not rationally reconstructed (Allchin, 1996, 2004). To enable informative contrast of a reasonable before with an unexpected after, the whole problem-solving episode should be amenable to retrospective analysis. It should be historical. In a similar way, to appreciate gender or racial bias or other ways that cultural perspectives may sometimes become blindly naturalized in science, one should be at a relatively remote vantage point to see the culture as culture. History and historical perspective are indispensable for such nature-of-science lessons.", "Finally, historical cases tend to change less with time. This year's hot topic will be pass soon, and the work assembling and refining a new contemporary case will start all over again. Costbenefit ratio of teacher preparation may be considered.", "Does the problem have one solution (possibly hidden) or many possible solutions? That is, in terms of the student's problem solving, is the process close-ended or open-ended? (Or, in terms of the literature on creativity, is the cognitive process convergent or divergent?) Each type shapes student motivation and an understanding of science (Cliff and Nesbitt, 2005). A problem for which there is a single known solution places students in a vulnerable position. Anytime a teacher fishes for a right answer, the responder risks being wrong. Such situations tend to alienate studentstypically expressed as silence or acquiescence. Similarly, a problem framed with an expected solution can diminish rather than enhance student motivation. Some students, of course, revel in puzzle-solving. Others feel threatened. Close-ended problems can also (alas) foster cheating or rationalization (working backward from a target solution)quite the opposite of what is intended. Where science content and/or information-finding skills are the aim, PBL may tend toward close-ended problems. But it need not. In biology, in particular, problems might be reframed and answered at different organizational levels simultaneously. Close-ended problems may also be used to help develop problem-solving or analytical skillsbut then one should carefully tailor assessment accordingly to promote and reward those skills, rather than just to yield the right answer. Finally, close-ended problems tend to support naive epistemological understanding of knowledge as stable, predetermined, and authority based (Schommer, 1990).", "Open-ended problems, by contrast, tend to promote more creative skills and thus motivate a wider variety of students. Such types of problems also seem essential for developing an epistemological understanding that knowledge is both creative and empirical and that science, while evidence based, is contingent, sometimes underdetermined and provisional. Historical problems, ostensibly already solved, would seem to be close-ended, but they can be situated in their original context, in an open-ended framework in which process and reasoning is more important than any specific conclusion. As noted above, investigations framed in historical context become science in the making again. (Indeed, teachers may face the greater challenge, trying to temporarily blind themselves to known outcomes in order to focus on process alone.)", "The cases that contextualize knowledge may be drawn from real-life examples, or they may be imaginatively assembled for an educational context. Constructed cases may be created to fit particular needs. They may be as simple or complex as one wants. They may be freely edited and streamlined to highlight core concepts or learning aims. One may readily generalize from them. On the other hand, constructed cases often carry an implicit aura of artificiality. They risk diminishing their motivational value if a student feels that they are contrived.", "Real cases, by contrast, are indeed authentic, although they are often messy. Still, the messiness can be an asset. First, the unique constellation of particulars can help demonstrate the sometimes unexpected ways in which different factors in science interact (sources of funding, personality, happenstance, disparate facts, etc.). Second, they can help students learn how to negotiate in a complex world. How does one recognize and tease out the relevant variables? Third, they may also contribute to shaping another basic dimension of epistemological belief: The structure of knowledge can be complex, not always simple (Schommer, 1990).", "At an impressive extreme, studentseven nonscience majors or K12 studentsmight participate in ongoing research. While tasks might not be any more demanding than gathering data, students may certainly understand the context of the work, see closely how it is structured, and take pride in contributing to developing original scientific knowledge (Crawford, 2012).", "Only some problems in the world (perhaps quite few) are well defined. A complete education thus helps develop skills in articulating ill-defined problems (Jonassen, 1997). One may also help foster skills in posing problems (Jungck, 1985; Gonzales, 1998). However, problem-solving skills themselves may well be best developed when the problem is already well defined and students are appropriately motivated. Of course, a problem may be redefined or dissolved: that may be part of the solution (concluding that the problem was ill framed or ill conceived at the outset).", "Ill-defined problems are typically a significant component in medical school problem-based education, reflecting the central role of diagnosis in clinical medicinethat is, of finding, characterizing, and identifying how or why the patient is not well. By contrast, cases used in business schools or law schools tend to be more well defined, reflecting the custom of addressing client-based criteria. In either case, refining or redefining a given problemor even dissolving it entirelymay well enter the process en route to a solution, as found in scientific research as well.", "A special category of PBL involves investigating rich data sets. These are already established measurements or results, but they are vast enough for exploration. Still, in an educational context, they have identifiable boundaries. Students may thus pose original problems that the data set may help answer. At the same time, one might entertain such enterprises mindfully. Some students may not share the instructor's or other students enthusiasm for investigation, even if they are given the freedom to frame their own question. Such students may thus become overwhelmed, discouraged, or even resentful. Opening problem-posing to students has risks (see also section on autonomy below).", "Like other forms of education, CBL or PBL may be either individual, collaborative, or cooperative. For more on the benefits and limits of cooperative learning in general, see Johnson and Johnson (1991). In PBL and CBL, classroom practice becomes an implicit general model for how research or problem solving is done. Is knowledge generated individually or collectively?", "Collaborative problem solving often involves special skills, such as brainstorming and supportive critique, which ideally become part of instruction. Collaboration should be further distinguished from cooperation, or group work, in which the product does not document or acknowledge the individual contributions of each group member (Panitz, 1996). That is, collaborative work maintains individual accountability. Each student may be responsible for a full product (case analysis, problem solution report, essay, exam, etc.) or for a discrete, identifiable portion of a final work product.", "Collaboration may be exercised on several levelsin pairs, in small teams, or even in large groups. Some exercises, such as a model United Nations, model Congress, or simulated summit on climate change may include dozens or hundreds of students. Role-play simulations, especially, can allow for creative synthesis among many unique student contributors within the same class, and thus exhibit the power of collaborative engagement. To help illustrate the epistemic value of collaboration, fragments of information for solving a complex problem may well be artfully distributed among different roles.", "While collaboration offers many potential benefits, working communally on a joint problem may be at odds with an individual pursuing a problem of personal relevance. Motivation (an alternative pedagogical aim) may suffer. Even if there is a consensus or a joint decision-making process, the shared problem may not engage all participants equally. Role-playing may be an effective pedagogical strategy for fostering a sense of personal responsibility through a vicarious as-if scenario.", "Cases or problems are often addressed cogently from a single perspective, whether of a contemporary individual or a renowned historical scientist. Simple cases streamline the process of problem solving, which is perhaps appropriate for the initial stages of PBL learning. However, some cases are problematic, precisely because interpretations of the core problem differ. Here, a student learns, first, that problem solving or research may not be exclusively individual or univocal: That is, it does not unfold according to some universal linear algorithm (such as the scientific method). Multiple perspectives may also prove an asset. Other viewpoints may reveal alternative solutions not readily envisioned within a particular mind-set or background. One of the greatest benefits of any class discussion may be simply exposing students to other perspectives. This can deepen their awareness of alternatives. Students report that they thereby broaden their ways of thinking. They can learn merely from listening to how other students view the same facts differently.", "Cases with multiple perspectives offer opportunities to teach about the social dimensions of developing knowledge and solving problems. Social epistemology, for example, has been highlighted recently by many philosophers of science (Longino, 1990; Goldman, 1999, 2002; Solomon, 2001), as well as by science educators (Osborne, 2010). When varying perspectives interact, one can enhance ways to analyze a problem or imagine its solution. Here, the instructional goal is to guide students in learning discursive skills, such as active listening, that contribute to such social-level analysis. Even criticism may have a positive role, exposing weak assumptions or increasing rigor of evidence. Tolerating criticism may an emotional or attitudinal skill, but it seems to have epistemic value. In yet other cases, in which interpretations conflict, students may learn skills in negotiating solutions or finding creative ways to accommodate apparently incompatible views (Fisher et al., 1991). Thus, CBL or PBL may adopt the familiar forms of a debate or role-play simulation (for well-developed complex examples, see Dunn et al. [2009] on Darwin and the Royal Society's Copley Medal in 1862; Allchin [2009a] on Galileo's trial in 1633; Allchin [2009b] on a presidential commission on pesticides in 1963; and Montgomery [2010] on glacial geology in 1843). Designated roles provide students a concrete perspective for interpreting a case or problem, which can serve as additional grounding. Unfamiliar roles (or sides in a debate) can also enhance appreciation of alternative perspectives. Even when students continue to work primarily on their own, however, one may still find a fruitful learning role for an exchange of multiple perspectives.", "The scope or magnitude of a case or problem itself may vary substantially, each with corresponding lessons. For brevity, consider three simple levels. First, vignettes or short stories focus on one relatively narrow question or problem. They can be easily inserted in a lecture format, say. But they are also limited. They convey that science and problem solving is easy and reductionistic. Second, lessons might extend over a full class period, as one activity or a series of short, related problems. Finally, one may use major projects that extend over several class periods, weeks, or the bulk of a semester if the complexity of the problem allows. For examples of the latter, see White (1992) on hemoglobin in biochemistry, Tewksbury (1999) on geology and the Aswan Dam, or Klassen (2006) on electrodynamics and the transatlantic cable. To the degree that science is complex and that education implicitly frames expectations beyond the classroom, teachers may well be encouraged to include some complex case studies or problems at some point in their courses as an indication of the real world and as an occasion for developing interpretive and organizational skills appropriate to such situations. One may also structure a series of lessons through a lineage of problemsas is frequently already done in teaching transmission genetics, atomic models, or the wave/particle nature of light (for example, the biology text by Mix et al. [1996] is organized on this principle).", "Scaling problems appropriately also has an important affective dimension, relevant to students long-term motivational context. In introducing PBL, especially, one might aim initially to create successful experiences, to promote positive attitudes toward further work (or at least averting a sense of failure that discourages future effort!). Coping with perceived failure as an outcomeor as a potential opportunity for learningmay itself be a goal but may well be reserved for more advanced levels.", "Student selection of the problem may contribute to the sense of ownership that makes the learning personal. But it need not. Some problems may be justified as of general interest or in a framework of public responsibility.", "One caution here is that, while the student may choose the problem, he or she generally does not have the option of not choosing a problem (say, because there is nothing of intrinsic interest). Here, the goal of using context as a motivator is lost.", "Does the teacher ever answer a question with anything other than another question? Depending on the local aims, the teacher may provide plentiful background information, including standard lectures. Alternatively, the student may be responsible for finding all such information (perhaps with guidance at the level of how to find that information). Or some intermediate form of support may be suitable to the aims and occasion at hand. The respective student challenges should not be overlooked.", "Problem-solving activities may be teacher-guided or student-directed. Guided work may be more important than earlier imagined (Mayer, 2004; Minstrell and Kraus, 2005), at least initially. Again, one responsibility for the instructor is to be familiar with (or pre-assess) student abilities and to frame problems at an achievable level. Even when students have autonomy, the teacher has a critical role as advisor and coach and possibly as a resource guide.", "When problem solving is collaborative, an important role is facilitating discussion. Teachers may adopt this role initially, again to model appropriate skills or to monitor and adjust progress along the way. Alternatively, students may be encouraged to develop such skills, sometimes in small groups, in an explicitly designated role.", "An important dimension of collaborative work is developing consensus when interpretations differ, especially by appeal to evidence and reasoning, rather than external authority (the instructor, say, or the textbook). Persuasion, argumentation, active listening, revising, and accommodating conflict creatively are among the skills to be addressed in a complete problem-solving education (Fisher et al., 1991; Osborne, 2010).", "Instructional strategies labeled as PBL and CBL embrace a wide range of intersecting but independent values. While some advocates may try to enforce strict definitions or best practices, an informed instructor should understand the various alternatives and be mindful of the differential outcomes (Table 1).", "Many educators construe CBL and PBL merely as methods. They imply that an instructor need only learn how to use the method, without understanding or endorsing the values or objectives embodied in certain aspects of the teaching style. The misaligned objectives and teaching style can confound students and, ironically, tarnish teaching quality. The discussion of the values and outcomes above can help inform effective choices and instructional design.", "Also, while noting a key role for motivation, many educators tend to profile PBL and CBL narrowly in cognitive terms. They sometimes overlook potential affective outcomes that shape, among other things, a learner's investment in learning and a respectful and fruitful teacherstudent relationship. Also, while parading the virtues of critical thinking or higher-order thinking skills, introductory presentations may disregard the implicit epistemic or nature-of-science lessons. For example, problem cases that apply knowledge may convey content well, but simultaneously present science as a reservoir of pre-established knowledge. They may eclipse epistemic understanding about how science generates new knowledge. Indeed, every science lesson indirectly conveys a message about scientific practices and the nature of scientific knowledge. The effective instructor mindfully manages these lessons, aware of potentially unintended outcomes.", "Finally, much educational research to date on the efficacy of PBL has been multivariate and failed to differentiate the roles of the individual dimensions noted above. What is the relationship between particular dimensions of teaching and particular outcomes for learners (e.g., motivation, attitudes toward the subject, autonomy in problem solving, problem-solving biases, nature-of-science understanding, and epistemological lessons), and when do they overlap? Ideally, research on CBL or PBL will focus on articulating the relevant variables and their corresponding effects.", "Most important, it may be prudent to acknowledge that the family of PBL and CBL strategies are not a panacea for any deficit in science education. They are tools. When used appropriately, a tool can be useful. But the specific tool depends on particular contexts and values. Even lecturing may, on occasion, have an indispensable role (say, in conveying the overall structure and organization of a field's knowledge).", "Acknowledging the limitations of CBL and PBL, however, one may also underscore the opportunities they offer. For example, one can hardly learn problem-solving skills without engaging problems. Posing problems for students to solve thus seems a central tool for much analytical and creative skill development. Likewise, participation in knowledge-generating cases, whether direct or vicarious, seems integral to learning or appreciating the nature of scientific research. Similarly, historical cases seem important to learning certain core nature-of-science themes. Finally, to develop more sophisticated epistemological perspectives, students should be exposed to complex cases (complex structure of knowledge), historical cases (conceptual change), knowledge-generating cases (empiricism as a source of authority), and successful experience in problem solving (active role of the knower; Schommer, 1990). Such views are, ultimately, foundational to continued and autonomous learningnamely, learning how to learn."],
