    sents: ["Journal Pre-proof Risk factors for predicting mortality in elderly patients with COVID-19: a review of clinical data in China Title: Risk factors for predicting mortality in elderly patients with COVID-19: a review of clinical data in China", "While elderly patients are at high risk of fatality, research concerning COVID-19 has largely been done on clarifying the clinical features.", "As such, the present work aims to identify risk factors for mortality in elderly patients with COVID-19.", "Given that single-centre studies are less likely informative as elderly remains a minority in the total Chinese population, the present study reviewed the clinical data of geriatric COVID-19 patients gathered from different sources in the public domain.", "Based on the data of 154 individuals from 26 provinces, age remained a key mortality risk factor among geriatric patients of different ages.", "While dyspnoea and chest pain/discomfort were more commonly seen in deceased patients as they represented severe pneumonia, fever was more prominent in surviving patients.", "This was likely due to the lower baseline body temperature observed in elderly which translated to a lower maximum temperature of fever.", "However, lowering the threshold temperature for fever is not recommended in surveillance.", "Instead, baseline body temperature measured on a regular basis should be used to define the threshold temperature for fever.", "Against mixed results, more research should be done on identifying comorbidities associated with mortality in geriatric patients."]
