    section_header: {
      original: ["Introduction", "Introduction", "Flavonoids as Antiviral Agents ::: Plant-Based Antiviral Molecules", "Alkaloids as Antiviral Agents ::: Plant-Based Antiviral Molecules", "Terpenes and Terpenoids as Antiviral Agents ::: Plant-Based Antiviral Molecules", "Terpenes and Terpenoids as Antiviral Agents ::: Plant-Based Antiviral Molecules", "Lignan as Antiviral Agents ::: Plant-Based Antiviral Molecules", "Coumarins as Antiviral Agents ::: Plant-Based Antiviral Molecules", "Coumarins as Antiviral Agents ::: Plant-Based Antiviral Molecules", "Patents on Phytochemicals as Antivirals", "Conclusions and Future Perspectives", "Conclusions and Future Perspectives"],
      generic: ["introduction", "introduction", "method", "references", "acknowledgments", "acknowledgments", "method", "method", "method", "method", "conclusions", "conclusions"]
