        "We consider M 2 number of stochastic random exchanges using Eq. (3) (4) between the cities before we update populations using Eqs. (5-7) (See numerical scheme in the Supplementary Information(SI), SI Note.1 ) in each time step. The number of exchanges are optimised in order to ensure significant amount of exchange of infected population among the cities that drives the process. In each of the time steps, we now solve 3M number of coupled differential equations alongside M 2 [20] number of random exchanges to extract the dynamics. We use the time step t = 1 for the integration throughout the calculation.",
        "We monitor the dynamics of such a state consisting of M = 64, 1024 and 4096 cities with identical initial population (N i = 1 at t = 0) for different ranges of magnitudes of connectivity parameter, . Here N i , S i , I i , R i represent the fraction of the total population in the state M . Each city has identical initial infected population as I i (0) = 0.0001 [21] . The initial conditions make sure that every city has identical behaviour for  = 1 when the cities are made isolated by some intervention protocol as, for  = 1, the cities retain all the population and does not actively take part in the exchanges. In contrast, they exchange freely for  = 0.",
