        "We now attempt to understand the COVID-19 data of the cases in different provinces of Germany using the insights of the model. The time series data for Germany for all 16 provinces are shown in Supplementary Information (SI Figs. [2] [3] [4] [5] . We now analyse the behaviour of / computed from the distribution of the infected populations in provinces of Germany (See SI Figs. [2] [3] [4] [5] . We see / has a sharp peak on 23rd March, 2020. In order to verify the heterogeneity, we further look at the dynamic statistical correlation between the daily new cases in the different provinces for the successive days, using the Pearson correlation between the distribution of the infected populations at all the provinces in time t and t + 1, given by (t, t + 1) = cov[P (I; t), P (I; t + 1)] (t)(t + 1)",
        "We show the dynamic statistical correlation, (t, t + 1) between the number of cases on successive days from all the federal states of Germany in Fig. 5 . We avoid the double count in the data. The trend in the statistical correlation behaves non-monotonically in the period, with a dip on 23rd March when the peak in   appeared, reiter- ating the effect of heterogeneity due to lack of dynamical statistical correlation. Surprisingly, the date exactly matches the date of the beginning of the lockdown in Germany. From the first week of April, there is a clear trend of flattening of the curve with significantly smaller number of cases with respect to the maximum numbers recorded on 27th March. Always, there are continuous exchanges of populations between the provinces in a country unless any intervention is imposed. The mobility between the cities without restriction, in principle resembles the  = 0 case of the model while the situation with strict intervention behaves as  = 1 case of the model when the cities are considered isolated. Considering time dependence in , it is possible to realize a dynamic picture from pre to post lockdown situations. The behaviour of / qualitatively features the balance between the spread of the infection in the cities and the relative change in the collective spread of the epidemic in the state. The extremum in / captures the extreme heterogeneity in the infection propagation as it optimize the relative balance between the local spread and drive in the collective transmission. On this note, the model that we use delivers the similar qualitative feature of the data of COVID-19 cases in the states of Germany.",
