      text: [
        "The factors that are responsible for the reactivation of latent Mtb infection are not well understood, but likely involve contributions from both the host and the pathogen. To appreciate the role that the host immune system plays in Mtb reactivation, we used relatively resistant (C57BL/6) or susceptible (CBA/J) mice, whose susceptibility phenotype is most apparent during late stages of infection, to represent differences in the natural progression of TB between different human populations. CBA/J mice have low numbers of antigen-specific CD4 T cells that produce relatively small amounts of IFN- [1][4]. CBA/J mice also have elevated amounts of IL-10 during Mtb infection [5], [6], contributing to their increased susceptibility to infection. However, the importance of CD8+ T cells during Mtb infection in this mouse strain remains unclear.",
        "CD8+ T cells are an important component of the protective immune response to Mtb, as defined by studies showing that mice deficient in CD8+ T cells had impaired control of Mtb infection [7][10]. Although there is no consensus on the specific requirement for CD8+ T cells during Mtb infection, CD8+ T cells can contribute to Mtb control by secretion of IFN- [11], [12] and cytotoxic lysis of host cells [13], [14], yet their ability to maintain maximal effector function is dependent on CD4+ T cells [15][17]. Studies have also reported that CD8+ T cells are most important during latent Mtb infection in mice, and that CD8+ T cell depletion early after infection had little effect on disease outcome [18]. Conversely, other studies suggest that CD8+ T cells are dispensable during Mtb infection [19][21].",
        "In chronic viral infection models, CD8+ T cells can become dysfunctional after chronic antigenic stimulation, characterized by a lack of functional or proliferative capability, secretion of IL-10 [22][24] and surface expression of inhibitory molecules, such as programmed cell death-1 (PD-1) and T cell immunoglobulin and mucin protein-3 (Tim-3) [25], [26]. PD-1 has classically been used as a marker of T cell exhaustion in viral infection and in cancer [27][30], while other studies have found that cells expressing Tim-3 are dysfunctional and lack regulation [31], [32], and that coexpression of PD-1 and Tim-3 leads to extensive dysfunction of CD8+ T cells [33]. Furthermore, CD8+ T cells expressing both PD-1 and CD122 (the  subunit of the IL-2 receptor) have been shown to have suppressive qualities and secrete IL-10 [34]. We, and others, have previously demonstrated that Mtb susceptibility in CBA/J mice is mediated by excessive pulmonary IL-10 during infection [1], [2], [5], [35], [36], yet the underlying mechanism remains unclear. Although numerous cell types are capable of producing IL-10, studies have previously shown that IL-10-producing T cells can actively suppress the immune response in TB patients [37], supporting an investigation into the IL-10-producing properties of CD8+ T cells during Mtb infection in CBA/J mice.",
        "In this study we show that Mtb-susceptible CBA/J mice accumulated large numbers of CD8+ T cells in their lungs as Mtb infection progressed that could not be fully accounted for by an expansion of IFN--producing CD8+ T cells. CD8+ T cell expansions expressed the inhibitory molecules PD-1, Tim-3, and/or CD122, and were capable of secreting IL-10. CD8+ T cells from CBA/J mice also preferentially expressed TcR V8 and V14, severely limiting the diversity of the CD8+ T cell repertoire. Although V8 CD8+ T cells could secrete IL-10, in vivo depletion of this specific T cell clonal population during chronic infection did not overtly change the Mtb burden in the lungs in the timeframe tested, although the amount of IL-10 in the lung was reduced indicating some biological impact of depletion. Comparing mouse strains that are relatively resistant and susceptible to Mtb has enabled us to uncover a previously unappreciated role for CD8+ T cells in Mtb susceptibility, and links the poor T cell function previously described by us [4], [6], [36] with increased production of IL-10 in the CBA/J mouse strain.",
        "This study was carried out in strict accordance with the recommendations in the Guide for the Care and Use of Laboratory Animals of the National Institutes of Health. The protocol was approved by the Institutional Animal Care and Use Committee of The Ohio State University.",
        "Specific pathogen-free, age/sex-matched CBA/J wild-type (National Cancer Institute, NIH, Frederick, MD), C57BL/6 wild-type (Jackson Laboratories, Bar Harbor, Maine), or CBA/J IL-10/ mice were maintained in ventilated cages inside a biosafety level 3 (BSL3) facility and provided with sterile food and water ad libitum. To generate CBA/J IL-10/ mice, CBA/J mice (Jackson laboratories, Bar Harbor, Maine) were crossed with C57BL/6 IL-10/ mice (Jackson) for eight generations. At each cross progeny mice were ear-punched and DNA was screened for the presence of a neomycin cassette at the il10 gene locus. IL-10+/ mice were selected for further breeding. At the eighth generation, heterozygotes were crossed and IL-10-deficient homozygote CBA/J mice were selected. A homozygous breeder colony of CBA/J IL-10/ mice was maintained thereafter. All protocols were approved by The Ohio State University's Institutional Laboratory Animal Care and Use Committee.",
        "\nMtb Erdman (ATCC 35801) was obtained from the American Type Culture Collection (Manassas, VA). Stocks were grown in Proskauer-Beck liquid medium containing 0.05% Tween 80 to mid-log phase and frozen in 1 mL aliquots at 80C. Mice were infected with Mtb Erdman using an inhalation exposure system (Glas-Col) calibrated to deliver 50100 CFU to the lungs of each mouse, as previously described [38]. At specific time points post Mtb infection mice were sacrificed and lungs were aseptically removed into sterile saline. Organs were homogenized and serial dilutions plated onto 7H11 agar supplemented with OADC as previously described [4]. Plates were incubated at 37C for 21 days in order to enumerate bacterial colonies and calculate the bacterial burden.",
        "Mice were euthanized by CO2 asphyxiation and lungs perfused with cold phosphate buffered saline containing 50 Units/mL of heparin through the right ventricle of the heart. Lungs from individual mice were mechanically disrupted using a GentleMACS dissociator (Miltenyi Biotec, Boston, MA) followed by collagenase A (type XI) (0.7 mg/mL, Sigma) and type IV bovine pancreatic DNAse (30 g/mL, Sigma) digestion at 37C for 30 minutes in GentleMACS C-tubes. Lung cell suspensions were passed through a 70 m nylon cell screen and residual erythrocytes were lysed with Gey's solution. Viable cells were determined by trypan blue exclusion.",
        "Single lung cell suspensions were adhered to sterile tissue culture dishes for 1 hr at 37C. Non-adherent cells were washed and removed from the plates. CD4+ and CD8+ T cells were obtained from the non-adherent cell fraction by magnetic cell separation (BD IMAG anti-CD4+ particles GK1.5, anti-CD8+ particles 536.7) and either placed directly into TRIzol reagent (Invitrogen, Grand Island, NY), homogenized, and frozen at 80C or used for culture as described below. CD8+V8+ T cells were obtained from the CD4neg fraction after treatment with anti-CD4 magnetic beads (BD), then stained with PE anti-V8 (eBioscience) and purified using anti-PE magnetic particles (BD). Purity of all CD4+ and CD8+ T cell populations was determined to be greater than 90% for all experiments by flow cytometry using an LSRII flow cytometer (BD Biosciences, San Jose, CA).",
        "For ELISpot, bone marrow-derived dendritic cells (BMDCs) were obtained from the tibiae and femora of age and sex matched non-infected wild-type or IL-10/ C57BL/6 or CBA/J mice. Cells were differentiated into dendritic cells using complete DMEM supplemented with 10% conditioned media derived from GM-EL4 cells, a GM-CSF-producing clone kindly provided by Arthur A. Hurwitz (NCI). 2106 bone marrow cells were plated at 37C in 1 ml of GM-EL4 conditioned media in sterile 24-well tissue culture plates. GM-EL4 conditioned media was replaced on days 2, 4 and 6. 3104 BMDCs were infected overnight with Mtb Erdman at an MOI of 11 then fixed in 2% paraformaldehyde (CBA/J IL-10/ BMDCs were used unfixed). Infected BMDCs were cultured with 2105 CD8+ T cells or CD8neg T cells for 72 hr at 37C in media containing either tissue culture media alone or 10 g/mL anti-CD3 (145-2C11) and 1 g/mL anti-CD28 (37.51). ELISpot reagents were obtained from eBioscience Ready-Set-GO! Spot-forming units (SFU) were enumerated with an ELISpot plate counter (C.T.L.).",
        "For ELISA, 1105 purified pulmonary CD8+ T cells were cultured with 10 g/mL anti-CD3 (145-2C11) and 1 g/mL anti-CD28 (37.51) for 72 hr at 37C with 5% CO2. After incubation, plates were frozen at 80C until all timepoints were completed. ELISA antibodies and standards were obtained from BD Biosciences and processed as previously described [38]. Colormetric reactions were read on a SpectraMax plate reader (Molecular Devices, Sunnyvale, CA).",
        "Isolated lung cells or MLN were suspended in deficient RPMI (Mediatech, Manassas, VA) supplemented with 0.1% sodium azide (Sigma-Aldrich). Surface targets were detected as previously described. Specific antibodies and isotype controls were purchased from BD Biosciences: PerCP-Cy5.5 anti-CD3 (145-2C11), allophycocyanin-Cy7 anti-CD4+ (GK1.5), PE-Cy7 anti-CD8+ (536.7), PerCP-Cy5.5 anti-CD8+ (536.7), PE-Cy7 anti-IFN- (XMG1.2), PE anti-PD-1 (J43), FITC anti-CD122 (TM-Beta 1), and FITC V screening kit. PE anti-Tim-3 (HAVCR2) antibody was purchased from eBiosciences. Cytokine levels were determined according to the manufacturer's instructions for intracellular cytokine staining (Cytofix/Cytoperm fixation/permeabilization solution kit with BD GolgiStop, BD Biosciences), following a 4 hr incubation with 1 g/mL anti-CD3 (145-2C11) and 0.1 g/mL anti-CD28 (37.51). Samples were read using an LSRII flow cytometer and analyzed with FACSDiva software (BD Biosciences).",
        "Anti-CD8+ (53.6.72) depletion antibody (BioXCell) or whole rat IgG2a (2A3) (BioXCell), were diluted to 2.5 mg/ml in PBS and stored at 80C. Thawed stocks were maintained at 4C for up to 1 month. Anti-V8 (F23.1) antibody-secreting cell line [39] was kindly provided by Dr. Michael Bevan. Antibody administration was modified based on Silva et al. [40] as follows: at day 90 post-infection, 0.5 mg of anti-CD8+ (53.6.72), anti-V8 (F23.1), or control antibody was injected into the peritoneal cavity of each mouse, followed by 0.5 mg at weekly intervals thereafter until the designated experimental time points. At the initiation of antibody treatment CBA/J mice consistently harbor 6.59 SE 0.12 log10\nMtb CFU [4].",
        "Statistical analysis performed using GraphPad Prism software for the Students t test per individual time point of each graph. Any comparisons between timepoints of the same experiment utilize a two-way analysis of variance test with Bonferonni post-tests for multiple comparisons. * p<0.05, ** p<0.01, *** p<0.001.",
        "Following aerogenic infection of CBA/J and C57BL/6 mice with Mtb we observed a gradual accumulation of CD4+ T cells in the lungs of C57BL/6 mice and significantly fewer CD4+ T cells within the lungs of CBA/J mice (\nFig. 1a\n), as we have previously described [3], [4]. In contrast to the reduced number of CD4+ T cells, CBA/J mice demonstrated a significant late accumulation of CD8+ T cells within the lungs as Mtb infection progressed (\nFig. 1b\n), eventually reaching or surpassing the number of pulmonary CD8+ T cells observed in C57BL/6 mice. This late accumulation was absent from C57BL/6 mice which reached a plateau at day 60. Skewing of T cell subset proportions in CBA/J mice could be better appreciated by determination of CD4CD8 ratios throughout the course of infection (\nFig. 1c\n), where a significant decline in the ratio of CD4+ to CD8+ T cells was observed by day 90 of Mtb infection, preceding the increasing CFU within the lungs of CBA/J mice (\nFig. 1d\n) [4], [6]. BrdU staining of pulmonary CD4+ (\nFig. 1e\n) and CD8+ T (\nFig. 1f\n) cells from CBA/J mice was not dramatically altered throughout infection, suggesting that the increased numbers of CD8+ T cells that were evident in CBA/J mice may not be due to local proliferation, but a consequence of enhanced cellular recruitment. CBA/J mice are known to produce abundant IL-10 in their lungs as Mtb infection progresses [5] and IL-10 can stimulate the proliferation of CD8+ T cells [41]. Therefore, we examined the numbers of CD4+ and CD8+ T cells present in the lungs of CBA/J IL-10/ mice over the course of Mtb infection (\nFig. 1g, h\n) and did not observe any differences between wild-type and IL-10/ CBA/J mice in CD8+ T cell accumulations at late stages of infection, demonstrating that CD8+ T cell expansions occur independent of IL-10. A significant increase in CD4+ and CD8+ T cells was observed in CBA/J IL-10/ mice at day 30, reflecting enhanced TH1 immunity in these mice (unpublished observations). These data demonstrate that the accumulation of CD8+ T cells in the lungs of CBA/J mice during chronic infection is not mediated by IL-10.",
        "We examined the number of T cells that were capable of secreting IFN- after ex vivo TcR stimulation. As expected, C57BL/6 mice had increasing numbers of CD4+\n[4] and CD8+ T cells that could produce IFN- as infection progressed (\nFig. 2a\n), which paralleled the increasing numbers of T cells within the lung (\nFig. 1\n). CBA/J showed an equivalent increase in IFN--producing CD4+ T cells (\nFig. 2b\n), albeit at a significantly lower number compared to C57BL/6, as we have previously described [3], [4]. Where the data differed, however, was in the finding that the number of IFN--producing CD8+ T cells reached a plateau as early as day 30 post-infection and did not increase any further, despite a significant accumulation of CD8+ T cells within the lungs of CBA/J mice. As Mtb infection progressed we also observed a significant increase in the number of CD8+ T cells from CBA/J mice that could express CD69 (\nFig. 2c\n), with over 40% of all CD8+ T cells in the lungs of CBA/J mice being activated during chronic infection. CD8+ T cells also expressed the suppressor of TH1 responses Tim-3 (\nFig. 2d\n), PD-1 (\nFig. 2e\n), with a small population expressing both PD-1 and CD122 (\nFig. 2f\n). Therefore, although highly activated, a proportion of CD8+ T cell expansions from chronic Mtb infected CBA/J mice had a phenotype that was not associated with TH1 cytokine secretion but was instead linked to immuno-suppressive properties including IL-10 production [34]. Because IL-10 production has been closely linked to Mtb susceptibility of CBA/J mice [5], we next examined the capacity of CD8+ T cells to produce IL-10.",
        "CD8+ and CD8neg cells were purified from the lungs of Mtb-infected CBA/J and C57BL/6 mice and cultured in IL-10 ELISpot plates for 72 hours with autologous bone marrow-derived dendritic cells (BMDCs) that had been infected with Mtb for 24 hours, in the presence or absence of anti-CD3 and anti-CD28. CD8+ cells from CBA/J mice, and not C57BL/6 mice, were capable of secreting IL-10 in response to TcR cross-linking (\nFig. 3a\n). In contrast, CD8neg cells from both mouse strains were capable of secreting IL-10 under these same conditions (\nFig. 3b\n). IL-10-secreting CD8neg cells were predominantly CD4+ as adherent cells were removed during cell purification and we have failed to detect IL-10 within B cells and neutrophils in both mouse strains (not shown). We also observed that CD8+ T cells from CBA/J and C57BL/6 mice were capable of secreting IFN- under the same culture conditions (measured in the IL-10 ELISPOT supernatants) (\nFig. 3c\n). Culture of purified CD8+ and CD8neg cells from Mtb infected CBA/J mice with Mtb-infected BMDCs in the absence of TcR cross-linking, indicative of an Mtb-specific response, resulted in the secretion of IL-10 from both CD8neg and CD8+ cells (\nFig. 3d\n). Interestingly, the capacity of CD8+ T cells to produce IL-10 increased over time, in parallel to the increasing CFU and CD8+ T cell numbers in the lung. The low SFU, relative to TcR cross-linking likely reflects the challenges of delivering of Mtb antigen into the appropriate processing pathway for presentation to CD8+ T cells.",
        "We determined the clonal repertoire of the CD8+ T cells that accumulated in the lungs of CBA/J mice during Mtb infection to determine whether the reactivity of CD8+ T cells was potentially driven by a dominant antigen, a concept supported by the finding of T cell clonal expansions in TB patients [42], [43]. At late stages of Mtb infection, we observed that CD8+ T cells from CBA/J mice primarily expressed two variable regions of the TcR beta chain (V). V8 (8.2,8.3) and V14 were expressed by approximately 45% of all CD8+ T cells in CBA/J mice at day 120 after Mtb infection, compared to a less restrictive repertoire in C57BL/6 mice (\nFig. 4a\n). V expression was comparable on CD4+ T cells from both mouse strains (\nFig. 4b\n), indicating a unique expansion within the CD8+ T cell pool in CBA/J mice as Mtb infection progressed. More detailed examination over the course of Mtb infection showed that the percentage of CD8+ T cells expressing V8 or V14 was always significantly higher throughout Mtb infection in CBA/J mice, and this population significantly expanded further at late time points of Mtb infection (\nFig. 4c, d\n). Similar to our findings with CD8+ T cell expansions, we found that both V8 and V14 CD8+ T cells were highly activated (\nFig. 4e\n).",
        "We determined the IL-10 producing capacity of CD8+ V8+ T cells using magnetic bead separation, which purified the dominant V8 expressing CD8+ population. CD8+ V8+ and CD8+ V8neg T cells were isolated from Mtb-infected CBA/J mice or C57BL/6 mice (controls) at day 150 post Mtb infection and cultured in IL-10 ELISpot plates with autologous IL-10 deficient BMDCs in the presence of anti-CD3/CD28. Significantly more CD8+ V8+ T cells from Mtb-infected CBA/J mice were capable of producing IL-10 than CD8+ V8neg T cells from CBA/J mice or from CD8+ V8+ and CD8+ V8neg T cells from C57BL/6 mice (\nFig. 4f\n). These data indicate a dominant role for CD8+ V8+ expressing T cells in the IL-10 production we previously observed in purified CD8+ T cell cultures. Culture supernatants were also assayed for IFN- by ELISA (\nFig. 4g\n) and our data indicate that CD8+ V8+ T cells can have dual secretion of IL-10 and IFN-, or represent a mixed population, as has been described by others [44].",
        "CD8+ T cells or V8+ cells were depleted from wild-type CBA/J mice from day 90120 after Mtb infection, a time when IL-10 and V8+ CD8+ T cells were increasing in the lungs of Mtb-infected CBA/J mice [5]. Following CD8+ depletion, Mtb CFU (\nFig. 5a\n), total CD4+ T cell numbers (\nFig. 5b\n) and IFN--producing CD4+ T cells (\nFig. 5c\n) were all moderately altered but data did not reach statistical significance. Interestingly, CD8+ T cell depletion led to a significant decrease in the total amount of IL-10 in the lungs of CBA/J mice (\nFig. 5d\n), reflecting the IL-10-secreting capacity of CD8+ T cells we observed in vitro. Depletion of CD4+ T cells led to significantly increased Mtb burden and mortality before day 120 (not shown) showing that depletion of a known protective T cell subset increased susceptibility. Specific depletion of V8+ cells also failed to significantly impact the Mtb burden (\nFig. 5e\n), although a modest reduction in CFU was similarly observed. This modest reduction, similar to our findings with CD8+ T cell depletion, suggests that although IL-10 producing CD8+ T cells may not negatively impact the growth of Mtb during the timeframe we investigated, they do not provide protection.",
        "We have demonstrated that clonal expansions of CD8+ T cells from CBA/J mice accumulate in the lung over the course of Mtb infection. This accumulation did not yield an equivalent increase in IFN-+CD8+ T cells and, upon further phenotypic examination, we discovered that highly activated CD8+ T cells from CBA/J mice expressed the T cell dysfunction markers PD-1 and Tim-3, as well as co-expression of PD-1 and CD122 suggesting possible immunosuppressive activity. After ex vivo purification and culture, it was shown that CD8+ T cells from CBA/J mice were capable of secreting IL-10 after TcR stimulation and in response to Mtb infected BMDCs. Depletion of V8+ cells or the entire CD8+ T cell population in Mtb-infected CBA/J mice led to a significant reduction in pulmonary IL-10 levels, however, we observed no significant change in pulmonary CFU.",
        "Using an Mtb-susceptible mouse strain, we reveal that CD8+ T cells that are capable of producing IL-10 can accumulate within the lung during Mtb infection. CD8+ T cells within the lung expressed CD69, indicative of activation and functional capacity, yet failed to show a concomitant enhancement of IFN--producing capacity. These findings indicate that highly activated CD8+ T cells within the lung have alternate function, which we show here to be the capacity to secrete IL-10, measured by ELISPOT due to the known difficulties of measuring IL-10 by intracellular flow cytometry. Altered function was associated with the co-expression of a variety of receptors know for negative regulation of cell function (PD-1, CD122, Tim-3) [25], [28], [33], [34]. In support of our findings, previous studies have shown that in chronic murine Mtb infection PD-1+ T cells can proliferate but fail to secrete IFN- unless this inhibition is overcome by direct TcR stimulation [45], [46]. It is unclear at this time why CD8+ T cells with inhibitory properties arise in CBA/J mice as Mtb infection progresses but we can hypothesize that this is a consequence of enhanced immune activation and subsequent exhaustion due to increasing bacterial loads in this mouse strain (Fig. 1) [4], [6].",
        "Our failure to observe any significant change in CFU following CD8+ or V8+ T cell depletion can be interpreted in several ways, the simplest being that IL-10-producing CD8+ T cells have no biological influence on the control of Mtb infection. While this is a possibility, we would reason that at the least the presence of IL-10-producing CD8+ T cells can be a putative biomarker of TB disease progression as they are only observed in a mouse strain of Mtb susceptibility, and IL-10 producing T cells have been previously described in the blood of TB patients [37]. In support of a negative role for CD8+ T cells in CBA/J mice, in vivo depletion led to a moderate, albeit not significant, decrease in CFU. Thus is in contrast to CD4+ T cell depletion in which all the mice were either dead or moribund before the necropsy time point (data not shown). These findings indicate that some CD8+ T cells from CBA/J mice fail to contribute to protection in a similar manner than might be expected from studies of other mouse strains [47][49]. One possibility for our failure to detect significant changes in CFU following CD8+ T cell depletion is our observation that CD8+ T cells can secrete both IL-10 and IFN-. Depletion of all CD8+ T cells would also remove a protective population, leading to a neutral effect. Previous studies from our laboratory have shown that blocking the action of IL-10 in CBA/J mice during Mtb infection provides enhanced protection [5], and we consider that blocking the action of IL-10 from IL-10/IFN--secreting CD8+ T cells contributed to this phenotype.",
        "In addition to IL-10 production, we also observed that CD8+ T cells from CBA/J mice had severely restricted diversity of their TcR repertoire which would significantly limit the breadth of antigens that CBA/J CD8+ T cells can recognize. CBA/J mice have an endogenous mouse mammary tumor virus (MTV-6) that selectively deletes various TcR V chains such as V8.1, and V 17a [50], [51] however this alone is not sufficient to explain the limited TcR diversity in CBA/J mice. It is possible that Mtb infection leads to specific deletion of certain subsets of protective CD8+ T cells or is driving clonal expansion of less protective cells (V8, V14). Alternatively V8/V14 CD8+ T cells in CBA/J mice may respond to a dominant Mtb antigen(s) expressed in vivo, where persistent responsiveness leads to immune exhaustion and subsequent regulation through receptors such as PD-1 and Tim-3. Clonal CD8+ expansions have been described in TB patients [52], including pediatric TB [42], supporting the relevance of our findings to TB in man. Clonal CD8+ expansions are also common in the elderly and in many viral models [42], [43], [53][58], yet their importance in Mtb infection is still unclear.",
        "In summary, we show using an Mtb-susceptible mouse strain (CBA/J) that clonal expansions of CD8+ T cells with the capacity to produce IL-10 can arise during chronic Mtb infection. In combination with our previous finding that blocking the action of IL-10 can improve outcome of Mtb infection [5], these data further support a negative role for IL-10 in the generation and maintenance of protective immunity against Mtb infection. Our findings are of significance because vaccines that specifically stimulate CD8+ T cells are currently under development [59][63]. Given that IL-10-secreting CD8+ T cells with the potential to negatively impact control of Mtb infection can naturally arise, generating such cells in response to vaccination should be considered."
